import { Routes, Route } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';

// import Home from "./Home";
import "./App.css";
import Register from "./pages/ٌegister";

function App() {
  return (
    <Routes>
        <Route path="/register" element={<Register />} />
    </Routes>
  );
}

export default App;
